import React from "react";
import './card.css';

const Card = (props) => {
    return(
        <div className="colaborador">
            <div className="cabecalho">
                <img src={props.imagem}/>
            </div>
            <div className="rodape">
                <h4>{props.nome}</h4>
                <h5>{props.cargo}</h5>
                <h6>{props.valor}</h6>
            </div>
        </div>
    )
}
export default Card;
